import react,{Component} from 'react'

const tableBody = () => {
    return (
        <tbody>
            <tr>
                <td>Charlie</td>
                <td>Janitor</td>
            </tr>
            <tr>
                <td>Mac</td>
                <td>Bouncer</td>
            </tr>
            <tr>
                <td>Dee</td>
                <td>Aspiring actress</td>
            </tr>
            <tr>
                <td>Riddhi</td>
                <td>Developer</td>
            </tr> 
        </tbody>
    )
}
const tableHead = () => {
    return (<thead>
        <tr>
          <th>Name</th>
          <th>Job</th>
        </tr>
      </thead>
      );
}
class Table extends Component{
    render(){
        return(
            <table>
        <tableHead />
        <tableBody />

      </table>
        )
    }
}

export default Table
